import React from "react";

function Header(){
    return (
    <div>
        <header className="navbar">Manuel Carretero</header>
        <p>This is a paragraph about me...</p>
        <ul>
          <li>Thailand</li>
          <li>Japan</li>
          <li>Nordic Countries</li>
        </ul>
    </div>
    )
}

export default Header;
